export function ListOfCategory({ categoryQuestionCount, clickable }: any) {

  const router = useRouter();
  // Step 1: Calculate the total question count
  const totalQuestions = categoryQuestionCount?.reduce((sum: any, user: any) => sum + user.questionCount, 0);

  // Step 2: Convert each question count to a percentage
  const usersWithPercentage = categoryQuestionCount?.map((user: any) => ({
    categoryName: user.categoryName,
    questionCount: user.questionCount,
    percentage: ((user.questionCount / totalQuestions) * 100).toFixed(0), // Convert to percentage and round to 2 decimal places
    categoryId: user.categoryId
  }));

  // const largestQuestionCategory = categoryQuestionCount?.reduce((prev: any, current: any) => {
  //   return (current.questionCount > prev.questionCount) ? current : prev;
  // });

  return (
    <div className="space-y-8 block ">
      <div className="relative overflow-x-auto sm:rounded-lg block">
        <table className="w-full text-sm text-left rtl:text-right text-gray-500">
          <thead className="text-xs text-gray-700 uppercase bg-gray-50">
            <tr>
              <th scope="col" className="p-4">
              </th>
              <th scope="col" className="px-6 py-3 text-xs text-slate-400">
                CATEGORY
              </th>
              <th scope="col" className="px-6 py-3 text-xs text-slate-400">
                RATE
              </th>
              <th scope="col" className="px-6 py-3 text-xs text-slate-400">
                COUNTS
              </th>
            </tr>
          </thead>
          <tbody>
            {usersWithPercentage?.map((item: any) => {
              const percentage = parseInt(item?.percentage);
              const width = `${percentage}%`
              return (
                <tr key={item.categoryName} className={`${clickable ? "cursor-pointer hover:bg-accent" : ""} `}
                  onClick={clickable ? () => (router.push(`category-details/${item.categoryId}`)) : undefined}>
                  <td className="w-4 p-4">
                    <div className="flex items-center">
                      {svg[item.categoryName]}
                    </div>
                  </td>
                  <th scope="row" className="px-6 py-4 font-medium text-gray-900 whitespace-nowrap min-w-44">
                    {item.categoryName}
                  </th>
                  <td className="px-6 py-4 flex items-center gap-2">
                    <div className="w-20 bg-gray-200 rounded-full h-1.5">
                      <div className={`bg-blue-600 h-1.5 rounded-full`}
                        style={{ width: width }}></div>
                    </div>
                    <span className='text-xs text-slate-400'>{item?.percentage}%</span>
                  </td>
                  <td className="px-6 py-4">
                    {item?.questionCount}
                  </td>
                </tr>
              )
            })}
          </tbody>
        </table>
      </div>
    </div>
  );
}
